import React from "react";
import FormModal from "./FormModal";

import zebraLogo from "../assets/images/zebra-logo.png"

import {
  MDBContainer,
  MDBNavbar,
  MDBNavbarBrand,
  MDBNavbarToggler,
  MDBNavbarNav,
  MDBNavbarItem,
  MDBNavbarLink,
  MDBCollapse,
  MDBBtn
} from 'mdb-react-ui-kit';

export default function ZNavbar()
{

  //alert('Nav-No: ' + Math.random(1000));
  
  const showModal = React.useRef(false);
  const formModalKey = React.useRef(1);
  const [refresh, setRefresh] = React.useState(false);

  const handleShow= (e) =>{
    e && e.preventDefault();
    
    showModal.current = true;
    //alert("ShowModel::" + showModal.current);
    setRefresh(!refresh);
    
  }

  formModalKey.current = formModalKey.current + 1;

  return (
  <>
      <MDBNavbar expand='lg' light style={{ backgroundColor: '#e3f2fd' }}>
      <MDBContainer fluid>
        <MDBNavbarBrand href='#'>
          <img
            src={zebraLogo}
            height='30'
            alt=''
            loading='lazy'
          />
          ZEBRA.AI
        </MDBNavbarBrand>
        <MDBCollapse navbar >
            <MDBContainer tag="form" fluid className='justify-content-end'>
            <MDBBtn outline color="success" className='me-2' type='button'>
              Suggestions
            </MDBBtn>
            
          </MDBContainer>
        </MDBCollapse>
      </MDBContainer>
    </MDBNavbar>

    {showModal.current && <FormModal showModal={true} key={formModalKey.current}></FormModal>}
  </>
  );

}
